import React from 'react';
import LargeButton from '../components/LargeButton';
import { Link } from 'react-router-dom';

const Home = () => {
    return (
        <div
            style={{
                display: 'flex',
                justifyContent: 'center',
                alignItems: 'center',
                height: '550px', // Centers vertically and takes full height
                gap: '50px', // Adds spacing between buttons
            }}
        >
            <Link to="/skills" style={{ textDecoration: 'none', display: 'inline-block' }}>
                <LargeButton
                    colour="blue"
                    label="Skills & Education"
                    desc="Coding languages, technologies, and educational accomplishments"
                />
            </Link>
            <Link to="/projects" style={{ textDecoration: 'none', display: 'inline-block' }}>
                <LargeButton
                    colour="yellow"
                    label="Projects & Experience"
                    desc="Exhibit of personal projects and work experiences"
                />
            </Link>
        </div>
    );
};

export default Home;
